import React from 'react';

const SkillTree = () => {
  const skills = [
    { name: 'Project Management', icon: 'üéØ', level: 'Level 80', unlocked: true, master: false, position: 'left' },
    { name: 'Augmented Reality', icon: 'üîÆ', level: 'Level 95 (MASTER)', unlocked: true, master: true, position: 'center' },
    { name: 'Design Patterns', icon: 'üèóÔ∏è', level: 'Level 85', unlocked: true, master: false, position: 'right' },
    { name: 'Virtual Reality', icon: 'ü•Ω', level: 'Level 90 (MASTER)', unlocked: true, master: true, position: 'left' },
    { name: 'Multiplayer', icon: 'üåê', level: 'Level 88', unlocked: true, master: false, position: 'center' },
    { name: 'Unity', icon: 'üéÆ', level: 'Level 95 (MASTER)', unlocked: true, master: true, position: 'right' },
    { name: 'Game Design', icon: 'üé®', level: 'Level 85', unlocked: true, master: false, position: 'left' }
  ];

  return (
    <section id="skills" className="game-section">
      <div className="skill-tree">
        <h2 className="section-title">Skill Tree</h2>

        <div className="tree-container">
          {/* Tree Trunk */}
          <div className="tree-trunk"></div>

          {/* Tree Branches */}
          <div className="tree-branches">
            <div className="branch branch-1"></div>
            <div className="branch branch-2"></div>
            <div className="branch branch-3"></div>
            <div className="branch branch-4"></div>
            <div className="branch branch-5"></div>
          </div>

          {/* Skills hanging on the tree */}
          <div className="skills-hanging">
            {skills.map((skill, index) => (
              <div 
                key={index} 
                className={`skill-fruit ${skill.unlocked ? 'unlocked' : ''} ${skill.master ? 'master' : ''} ${skill.position}`}
                style={{ animationDelay: `${index * 0.2}s` }}
              >
                <div className="fruit-stem"></div>
                <div className="fruit-content">
                  <div className="skill-icon">{skill.icon}</div>
                  <div className="skill-name">{skill.name}</div>
                  <div className="skill-level">{skill.level}</div>
                </div>
                <div className="fruit-glow"></div>
              </div>
            ))}
          </div>

          {/* Tree Roots */}
          <div className="tree-roots">
            <div className="root root-1"></div>
            <div className="root root-2"></div>
            <div className="root root-3"></div>
          </div>

          {/* Floating particles around the tree */}
          <div className="tree-particles">
            {[...Array(12)].map((_, i) => (
              <div 
                key={i} 
                className="tree-particle"
                style={{ 
                  animationDelay: `${i * 0.3}s`,
                  left: `${Math.random() * 100}%`,
                  top: `${Math.random() * 100}%`
                }}
              ></div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default SkillTree;
